import React, {useState} from 'react';
import Panel from './Panel';
import './PanelList.css';


const PanelList = ({ pokedex }) => {
    const [card, setCard] = useState(null)

    useEffect(() => {

        const functionForEvent = () => {
            console.log("here is the end")
            console.log(card);
            // console.log(PanelCompon[carNumb]);
        }

        const handleEvent = event => {
            console.log("handle enent trigger")
            functionForEvent();
        }

    },[card]);

    const PanelCompon = pokedex.map((pokemon, i) => {
        return <Panel onChildEvent={handleEvent} onChange={num => setCard(num)} panelId={i} id={pokedex[i].id} name={pokedex[i].name} types={pokedex[i].types}/>
    })


    return (
        <div>
            <div>
                <div>

                </div>
            </div>
            <div>
                {PanelCompon}
            </div>
        </div>
    );
}

export default PanelList;
